import React from "react";
import SlotMatch from "./SlotMatch";

const SlotM = (props) => {
    let x = props.x;
    let y = props.y;
    let z = props.z;
    
    if(x===y && y===z) {
      return (
        <SlotMatch x= {x} y= {x} z ={x} />
      )
    } else {
      return (
        <>
        <div className='slot_inner'>
          <h3>{x} {y} {z}</h3>
          <h3>This is not matched</h3>
         
        </div>
        </>
      )
    }
  }

  export default SlotM;
